import React from 'react'; 
import './plan.css';
import Planitem from './Planitem';

 
export default function Plan(props) {
    const pricebgimg = {
        backgroundImage:`url(${pricebg})`
    }
  return <>
    {Planitem.map((e) => {
        return(
            <div className='col-md-3'>
                <div className='planitem'>
                   <div className='price'>
                       <sub>$</sub>{e.Price}<sub>/Month</sub>
                   </div>
                   <div className='PlanTitle' style={pricebgimg}>
                      {e.PlanTitle}
                   </div> 
                </div>
            </div>
        )

    })}
  </>
}
